import React from "react";

import DeleteSweepIcon from '@material-ui/icons/DeleteSweep';

const Getval = (props) => {

    return (
        <>
            <div className="theitem">
                <span onClick={doAction}> <DeleteSweepIcon /> </span>
                <li>
                    {props.text}
                </li>
            </div>
        </>
    );
}

export default Getval;
